description:
Camp Hope (2010)  

Verenigde Staten
Horror / Thriller
91 minuten

geregisseerd door George VanBuskirk
met Bruce Davison, Valentina de Angelis en Spencer Treat Clark

Een groep christelijke kinderen uit New Jersey begeeft zich naar 'Camp Hope'. Ze trekken diep de bossen in, weg van alle dingen in de wereld. Een priester is echter iets duivels met de groep kinderen van plan, en heeft een wel heel kwaad iets meegebracht...

Vertaald door Simply ReleaseS Toppers
Badgast en Ehr Ashjee

